import Skills from '../Skills/Skills'
import CallToAction from '../CallToAction/CallToAction';
// import WordTransition from '../WordTransition/WordTransition'
import {Parallax, ParallaxLayer} from 'react-spring/renderprops-addons'



const Home = () => {
  return (
      <>
    {/* <Box component="div" style={{ background: "#5f5b60", height: "100vh" }}> */}
    <Parallax pages={3} scrolling={false} horizontal ref={ref => (this.parallax = ref)}>
  <ParallaxLayer offset={0} speed={0.5} onClick={() => this.parallax.scrollTo(1)}>
    <span onClick={() => this.parallax.scrollTo(1)}> <CallToAction/></span>
  </ParallaxLayer>
</Parallax>

{/* <WordTransition/> */}
<MainProjects/>

      <Skills/>
      <Projects />
      <Footer />
    {/* </Box> */}
    </>
  );
};

export default Home;
